import React, { Component } from "react";
import Me from './assets/images/me.png';
import './assets/stylesheets/nav.scss';

class Nav extends Component {
    render() {
        return (
            <div className="navbar bg-dark navbar-expand-md">
                <div className="container">
                    <a className="navbar-brand" href="index.html">
                        <img className="navbar-floating-logo d-none d-lg-block" src={Me} alt="Around" width="100" />
                    </a>
                    <ul className="navbar-nav">
                        <li className="nav-item">
                            <a className="nav-link" href="#shots">Portfolio</a>
                        </li>
                    </ul>
                </div>
            </div>
        )
    }
}
export default Nav
